import {TopBar} from './Components.js';
import './App.css';

import React from "react";

function ResourcesCyberSecurityAndPrivacy() {
    return(
        <>
            <TopBar/>
            <div className='background-color-verylightorange'>
                <h1 style={{marginTop: "0px", padding: "50px"}}>Cybersecurity &<br/> Privacy</h1>
                <p>Cybersecurity and privacy are significant issues that can impact a person's daily<br/>life.</p>
            </div>
        </>
    );
}

export default ResourcesCyberSecurityAndPrivacy;
